import React from "react";
import { Modal } from "react-bootstrap";
export default function MyModal(props) {
	const { open } = props;
	return (
		<div>
			<Modal
				open={open}
				onClose={handleClose}
				aria-labelledby="simple-modal-title"
				aria-describedby="simple-modal-description"
			>
				{body}
			</Modal>
		</div>
	);
}
